componentsModule.modules.status={start:function(){let current=componentsModule.modules.status;current.parentElement=document.querySelector("[data-component=status]");current.selectElement=current.parentElement.querySelector("select");current.selector=current.createSelector()},createSelector:function(){return new Selector({selector:"select[name=component_status]",onOpen:reloadPackery,onClose:reloadPackery})},resume:function(){let current=componentsModule.modules.status;const b=current.parentElement.getAttribute("data-resume");if(b===""){return true}const a=JSON.parse(b).status;let selectOptions=current.selectElement.querySelectorAll("option");Object.values(selectOptions).forEach(function(c,d){if(d!==a){c.removeAttribute("selected")}else{c.setAttribute("selected","true")}});current.selector.destroy();current.selector=current.createSelector()},validate:function(){const a=componentsModule.modules.status.serialize().status;return(a>-1&&a<4)},serialize:function(){return{status:parseInt(componentsModule.modules.status.selectElement.querySelector("[selected=true]").getAttribute("value"))}}};